void rd(int vet[], int Tam=TAM){
  srand (time(NULL));
  int a,b;
  for (int i=0;i<5;i++){
    for (int j=0;j<Tam;j++){
      b=rand() % 500;
      a=vet[j];
      vet[j]=vet[b];
      vet[b]=a;

    }
  }


}

void imprimir(int nums[], int t =TAM) {
  cout << "Vetor: ";
  for (int i = 0; i < t; i++) {
    cout << nums[i] << " ";
  }
  cout << "\n\n\n";
}

void insercaoDireta(int nums[], int Tam) {
  for (int j = 1; j < Tam; j++) {
    int chave = nums[j];
    int i = j - 1;
    while (i >= 0 && nums[i] > chave) {
      nums[i + 1] = nums[i];
      i--;
    }
    nums[i + 1] = chave;
  }
  cout << "Insero direta: ";
  imprimir(nums,Tam);
}

void bolha(int nums[],int Tam) {
  bool troca = true;
  int lim = Tam - 1;
  while (troca) {
    troca = false;
    int k;
    for (int i = 0; i < lim; i++) {
      if (nums[i] > nums[i + 1]) {
        int aux = nums[i];
        nums[i] = nums[i + 1];
        nums[i + 1] = aux;
        k = i;
        troca = true;
      }
    }
    lim = k;
  }
  cout << "Bolha: ";
  imprimir(nums,Tam);
}

void quickSort(int nums[], int esq, int dir,int Tam){
  int pivot, i, j, aux;
  i = esq;
  j = dir;
  pivot = nums[(i+j)/2];
  do {
    while(pivot>nums[i]){
      i++;
    }
    while(pivot<nums[j]){
      j--;
    }
    if(i<=j){
      aux = nums[i];
      nums[i] = nums[j];
      nums[j] = aux;
      i++;
      j--;
    }
  } while (i<j);
  if(esq < j){
    quickSort(nums, esq, j,Tam);
  }
  if(dir > i){
    quickSort(nums, i, dir,Tam);
  }

  if (esq == 0 && dir == TAM) {
    cout << "Quick Sort: ";
    imprimir(nums,Tam);
  }

}

void selecaoDireta(int nums[],int Tam){
  int aux;
  for(int i=0;i<=Tam-2;i++){
    int posMenor = i;
    for(int j=i+1;j<=Tam-1;j++){
      if(nums[j] < nums[posMenor]){
        posMenor = j;
      }
    }
    aux = nums[i];
    nums[i] = nums[posMenor];
    nums[posMenor] = aux;
  }
  cout << "Seleo Direta: ";
  imprimir(nums,Tam);
}

void merge(int vetorDaEsquerda[], int vetorDaDireita[], int vetorCompleto[], int tamanhoEsquerda, int tamanhoDireita){

int i=0, j=0, k =0;
  while(i < tamanhoEsquerda && j < tamanhoDireita){
    if(vetorDaEsquerda[i] < vetorDaDireita[j]){
      vetorCompleto[k] = vetorDaEsquerda[i];
      i++;
      k++;
    } else {
      vetorCompleto[k] = vetorDaDireita[j];
      j++;
      k++;
    };
  }
  while(i < tamanhoEsquerda){
    vetorCompleto[k] = vetorDaEsquerda[i];
    i++;
    k++;
  }
  while(j < tamanhoDireita){
    vetorCompleto[k] = vetorDaDireita[j];
    j++;
    k++;
  }
}

void mergesort(int vetorDeNumeros[], int tamanho){
  int meio = tamanho/2;
  int vetorEsquerdo[meio];
  int vetorDireito[tamanho - meio];

  if(tamanho <= 1){
    return;
  }

  int j=0;
  for(int i = 0; i < tamanho; i++){
    if(i < meio){
      vetorEsquerdo[i] = vetorDeNumeros[i];
    } else {
      vetorDireito[j] = vetorDeNumeros[i];
      j++;
    }
  }
  mergesort(vetorEsquerdo, meio);
  mergesort(vetorDireito, tamanho-meio);
  merge(vetorEsquerdo, vetorDireito, vetorDeNumeros, meio, tamanho-meio);

  if (tamanho == TAM) {
    cout << "Mergesort: ";
    imprimir(vetorDeNumeros, tamanho);
  };

}


